VALUES 
	 {{appsmith.store.newList.map((d) => { 
	return"(" + "'" + d.id+ "', " + "(SELECT i.\"InvoiceID\" FROM \"public\".\"Invoice\" i INNER JOIN \"public\".\"Customers\" c1 ON ( c1.\"Id\" = i.\"CustomerID\")  WHERE i.\"InvoiceDate\" >= '"+ moment(DatePicker1.selectedDate).format("YYYY-MM-DD") +"' AND i.\"InvoiceDate\" < '"+ moment(DatePicker1.selectedDate).add(1,"days").format("YYYY-MM-DD") + "'AND c1.\"OrgID\" = '" + d.orgID + "')," + "'" + d.productDesc + "'," + d.quantity + " ,'" + d.destinationCountryCode + "'," + "'" + d.groupID + "'," + (d.parentID === null ? null : `'${d.parentID}'`) + "," + d.pages +")"}).join(",")  }};
